    the close of 2006 as to the appropriate 2007 fixed allocation ratio, and has applied
    the incorrect Non-Presidential and Non-Senate 15% fixed allocation ratio consistently
    since 1/1/2007.    Upon review and consultation with Commission staff, it is clear
    as pointed out by the Commission under 11 CFR 106.7(d)(2) and (3) that the appropriate
    fixed allocation ratio for these types of expenses for this committee in Nevada
    is Presidential Only Election Year 28% fixed allocation ratio. In the original
    report filed 9/20/2007 the amount transferred from the non-federal to allocation
    account for allocated expenses was $796.90. Based on the changes reflected in
    this amended report the correct amount that should have been transferred is $696.81,
    resulting in an excessive transfer of $100.09. The committee will transfer this
    amount from the federal to the non-federal account on 10/22/2007 to correct this
    error.    This adjustment ? along with others due to amended reports covering
